import React from 'react';
import './App.jsx';

import ComParametro from './components/ComParametro';
import Card from './components/layout/Card';


export default (props) => (
    <div clasName="App">

        <Card titulo='#03 - Componente Com Parametro'>
            <ComParametro titulo='Boeing 737-700' subtitulo='Esse é o subtítulo' imagem="https://media.giphy.com/media/3o6nUN1sHVfSgjCj72/giphy-downsized-large.gif?cid=ecf05e479dhgl42w6b85tu05qy02strz7elblgfyctdpj62f&rid=giphy-downsized-large.gif&ct=g"/>
        </Card>
        <Card titulo='#03 - Componente Com Parametro'>
            <ComParametro titulo='Boeing 737-700' subtitulo='Esse é o subtítulo' imagem="https://media.giphy.com/media/3o6nUN1sHVfSgjCj72/giphy-downsized-large.gif?cid=ecf05e479dhgl42w6b85tu05qy02strz7elblgfyctdpj62f&rid=giphy-downsized-large.gif&ct=g" loc='https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7714.530971693337!2d-39.03571330085438!3d-14.810350726596258!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x739a0bea0b7c0a7%3A0x23395f93c8ca1124!2sIlh%C3%A9us%20Airport!5e0!3m2!1sen!2sbr!4v1630033065372!5m2!1sen!2sbr" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy"></iframe>' video="https://www.youtube.com/embed/f02mOEt11OQ"/>
        </Card>
        
    </div>
)
